import style from "./App.module.css";
import Navbar from "./Components/UI/NavBar";
import Content from "./Components/Content/index";
import ContextProviders from "./Storage";

function App() {
  return (
    <ContextProviders>
      <div className={style.main}>
        <Navbar />
        <Content />
      </div>
    </ContextProviders>
  );
}

export default App;
